function initShaders(c,d,b){var a=createProgram(c,d,b);if(!a){console.log("Failed to create program");return false}c.useProgram(a);c.program=a;return true}function createProgram(f,h,d){var e=loadShader(f,f.VERTEX_SHADER,h);var a=loadShader(f,f.FRAGMENT_SHADER,d);if(!e||!a){return null}var b=f.createProgram();if(!b){return null}f.attachShader(b,e);f.attachShader(b,a);f.linkProgram(b);var g=f.getProgramParameter(b,f.LINK_STATUS);if(!g){var c=f.getProgramInfoLog(b);console.log("Failed to link program: "+c);f.deleteProgram(b);f.deleteShader(a);f.deleteShader(e);return null}return b}function loadShader(f,b,d){var c=f.createShader(b);if(c==null){console.log("unable to create shader");return null}f.shaderSource(c,d);f.compileShader(c);var e=f.getShaderParameter(c,f.COMPILE_STATUS);if(!e){var a=f.getShaderInfoLog(c);console.log("Failed to compile shader: "+a);f.deleteShader(c);return null}return c}function getWebGLContext(a,b){var c=WebGLUtils.setupWebGL(a);if(!c){return null}if(arguments.length<2||b){c=WebGLDebugUtils.makeDebugContext(c)}return c};